  "text" : "\uAD6D\uBBFC \uBAA8\uB450\uAC00 \uC77D\uC5B4\uC57C \uD560 \uD544\uB3C5\uC11C\uB780 \uC0DD\uAC01\uC774 \uB4E0\uB2E4. \uC5B4\uB5A4 \uC5F4\uC545\uD55C \uC0C1\uD669 \uB54C\uBB38\uC5D0 \uD544\uB3C5\uC11C\uB97C \uCD94\uCC9C\uD55C\uB2E4\uB294 \uAC74 \uB108\uBB34 \uAC00\uC2B4 \uC544\uD508 \uC77C\uC774\uC9C0\uB9CC.\n\n\u2026  \uC778\uAC04\uC758 \uAD8C\uB9AC\uC640 \uBD88\uAD74\uC758 \uC9C4\uB9AC\uC5D0 \uB300\uD55C \uC774 \uC5F4\uB82C\uD55C \uC639\uD638\uAC00 \uC804\uD558\uB294 \uAC10\uB3D9\uC758 \uC804\uC728 \uBABB\uC9C0 \uC54A\uAC8C, \uC774 \uCC45\uC5D0\uC11C \uB3C5\uC790\uB4E4\uC740 \uB610\uD55C \uC778\uAC04\uC758 \uBCF5\uD569\uC801",
