  "text" : "\uC774\uB7F0 \uB9E5\uB77D\uC5D0\uC11C \uD574\uC11D\uB420 \uC218\uB3C4 \uC788\uC744 \uAC83\uC774\uB2E4. \uB610 \uC77C\uBC18 \uD615\uBC95\uC758 \uD615\uB7C9\uC744 \uD6E8\uC52C \uC0C1\uD68C\uD558\uB294 \uB9CE\uC740 \uD2B9\uBCC4\uD615\uBC95\uB4E4- \uC608\uCEE8\uB300 '\uD2B9\uC815\uBC94\uC8C4 \uAC00\uC911\uCC98\uBC8C\uBC95', '\uD3ED\uB825\uD589\uC704 \uB4F1 \uCC98\uBC8C\uC5D0 \uAD00\uD55C \uBC95\uB960'\uB4F1\uC758 \uC81C\uC815 \uC2DC\uAE30\uAC00 5\uACF5\uD654\uAD6D \uC218\uB9BD \uC9C1\uD6C4\uC778 1980\uB144\uACBD\uC774\uC5C8\uB2E4\uB294 \uC0AC\uC2E4\uB3C4 \uC774\uB7EC\uD55C \uC810\uC744 \uC608\uC99D\uD55C\uB2E4.",
