  "text" : "\uB85C\uB4DC \uBC14\uC774\uD06C\uB294 '\uB85C\uB4DC \uBC14\uC774\uD06C\uB97C \uD0C8 \uC0DD\uAC01\uC774 \uC788\uACE0, \uB85C\uB4DC \uBC14\uC774\uD06C\uB97C \uD0C8 \uC2E4\uB825\uB3C4 \uB418\uBA74\uC11C \uB85C\uB4DC \uBC14\uC774\uD06C\uB97C \uD0C8 \uD544\uC694\uB97C \uB290\uAEF4\uC11C' \uC0AC\uC57C \uD558\uB294 \uC790\uC804\uAC70\uB77C\uACE0 \uC0DD\uAC01\uD568. \uC5BC\uB9C8\uC804\uC5D0 \uB0A8\uC774 \uBD80\uCD94\uAE30\uB294 \uC774\uC57C\uAE30\uB9CC \uB4E3\uACE0\uC11C \uB85C\uB4DC \uC0C0\uB2E4\uAC00 \uB118\uC5B4\uC838\uC11C \uD06C\uAC8C \uB2E4\uCE5C \uC0AC\uB78C\uC774 \uC8FC\uBCC0\uC5D0 \uC788\uC5B4\uC11C \uD558\uB294 \uC774\uC57C\uAE30.",
